import classes from "./RandomColorGenerator.module.css"

const RandomColorGenerator = () => {
    return (
        <>
            <div className={classes.buttonContainer}>
                <button className={classes.button}>Generate HEX Color</button>
                <button className={classes.button}>Generate RGB Color</button>
                <button className={classes.button}>Generate random color</button>
            </div>
        </>
    )
}
export default RandomColorGenerator;
